import "./App.css";

function App() {
  return (
    <div className="App">
      <div id="background"></div>
      <img src={require("./images/background.png")} alt="" id="bg-top" />
      <img src={require("./images/background.png")} alt="" id="bg" />
      <div className="container">
        <div className="row t1 p-5">
          <div className="col text-center mx-3 d-flex justify-content-center align-items-center">
            <h1 className="display-4 m-0 " id="welcome">
              Welcome to AI Jokes
            </h1>
            <img
              src={require("./images/logo.png")}
              id="logo"
              className="ms-4"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
